import React from 'react';

function Card(props){
    const style = {
        width : "17rem"
    }
    console.log("prop")

    return(
        <div className={props.cal === undefined ? `card`: `card ${props.cal.className}`} style={props.cal === undefined ? {} : style} >
                <img class="card-img-top" src="..." alt="Card image cap" />
                <div class="card-body">
                    <h5 class="card-title">adadadad</h5>
                    <p class="card-text">afafefdfs</p>
                </div>
            </div>
    )
}
export default Card;
